import { combineReducers } from "redux";
import authReducer from "./authReducers";
import errorReducer from "./errorReducers";
import gridReducer from "./gridReducers";
export default combineReducers({
	auth: authReducer,
	errors: errorReducer,
	grid: gridReducer
});
